import React, { useState, useEffect, useCallback } from 'react';

// Icons
const SaveIcon = ({ className = "w-4 h-4" }) => <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}><path d="M19 21H5a2 2 0 0 1-2-2V5a2 2 0 0 1 2-2h11l5 5v11a2 2 0 0 1-2 2z" /><polyline points="17 21 17 13 7 13 7 21" /><polyline points="7 3 7 8 15 8" /></svg>;
const PlusCircle = ({ className = "w-5 h-5" }) => <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}><circle cx="12" cy="12" r="10"></circle><line x1="12" y1="8" x2="12" y2="16"></line><line x1="8" y1="12" x2="16" y2="12"></line></svg>;


// Diese Komponente rendert die spezifischen Eingabefelder für den ausgewählten Test.
const TestInputForm = ({ testId, onResultsChange }) => {
    const [results, setResults] = useState({});

    const handleChange = (e) => {
        const { name, value, type } = e.target;
        const newResults = { ...results, [name]: type === 'number' ? parseFloat(value) || 0 : value };
        setResults(newResults);
        onResultsChange(newResults);
    };

    // Stellt sicher, dass die Felder zurückgesetzt werden, wenn sich der Test ändert.
    useEffect(() => {
        setResults({});
        onResultsChange({});
    }, [testId, onResultsChange]);

    const inputStyle = "mt-1 block w-full px-3 py-2 bg-white border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-teal-500 sm:text-sm";

    switch (testId) {
        case 'hscl11':
            return (
                <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mt-4">
                    <div>
                        <label className="block text-sm font-medium text-gray-700">Angstwert (GSI)</label>
                        <input type="number" step="0.1" name="angstwert" value={results.angstwert || ''} onChange={handleChange} className={inputStyle} />
                    </div>
                    <div>
                        <label className="block text-sm font-medium text-gray-700">Depressionswert (GSI)</label>
                        <input type="number" step="0.1" name="depressionswert" value={results.depressionswert || ''} onChange={handleChange} className={inputStyle} />
                    </div>
                </div>
            );
        case 'bdi2':
            return (
                 <div className="mt-4">
                    <label className="block text-sm font-medium text-gray-700">BDI-II Summenwert</label>
                    <input type="number" name="summenwert" value={results.summenwert || ''} onChange={handleChange} className={inputStyle} />
                </div>
            );
        default:
            return <p className="mt-4 text-sm text-gray-500">Für diesen Test ist noch kein Eingabeformular definiert. Sie können ihn trotzdem ohne spezifische Werte speichern.</p>;
    }
};


const ZentraleDiagnostik = ({ availableTests, onAddTest }) => {
    return (
        <div className="max-w-6xl mx-auto">
            <h2 className="text-2xl font-semibold text-gray-800 mb-6">Neuen Test für einen Patienten erfassen</h2>
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-5">
                {availableTests.map(test => (
                    <div key={test.id} className="bg-white p-5 rounded-xl border border-gray-200 shadow-sm flex justify-between items-center transition-shadow hover:shadow-md">
                        <div>
                            <p className="font-bold text-gray-800">{test.name}</p>
                            <p className="text-sm text-gray-500 mt-1">EBM: {test.ebm}</p>
                        </div>
                        <button 
                            onClick={() => onAddTest(test)} 
                            className="text-teal-500 hover:text-teal-700 hover:bg-teal-50 p-2 rounded-full transition-colors"
                            title={`Test "${test.name}" hinzufügen`}
                        >
                            <PlusCircle className="w-7 h-7" />
                        </button>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default ZentraleDiagnostik;
